import React, {FC} from 'react';
import Toe, {Type} from "./Toe";

export interface GameProps {
    width?: string,
    height?: string
}


const Game: FC<GameProps> = (
    {
        width = '300px',
        height = '300px'
    }) => {
    return (
        <div
            style={{
                width,
                height,
                display: 'flex',
                flexWrap: 'wrap',
                alignItems: 'center',
                justifyContent: 'space-around'

            }}
        >

        </div>
    );

};


export default Game;
